    const [TaskList, setTaskList] = useState([])

    const changeFlag = () =>{
      setFlag(!flag)
    }
    useEffect(() => {
      const load_g = async ()=>{


        axios.get('http://127.0.0.1:8000/api/groups/')
        .then(result =>{
            setTaskList(result.data)
        })
        
      }
      load_g()

  
    }, [flag])

    return(
    <Container className="Home">
        <p>{props.gid}</p>
    </Container>
      )
  }

